import React from 'react';
import ReactDOM from 'react-dom';

const users = ["Mohan","Ramesh","Suresh","Dinesh","ganesh"];
ReactDOM.render(
    React.createElement('ul',null,
    users.map(u => React.createElement('li',null,u))), 
    document.getElementById('root')
);
